import React from 'react';

function Secondprofile({secondProfile, setSecondProfile}) {
    const [loading, setLoading] = useState(true);
    let platform = "pc";
    let region = "us";
    let profile = "Koko-11570"; 
    const allStatsURL = `https://ow-api.com/v1/stats/${platform}/${region}/${profile}/complete`;

    useEffect(() => {
      const getData = async () => {
        const res = await axios.get(allStatsURL);

        setSecondProfile(res.data);
        setLoading(false);
      }
      getData()
    }, []);

    if (loading) {
      return <h1> Loading</h1>;
    } else {
      console.log(secondProfile.rating);
      return (
          <div> {profile} is {secondProfile.rating} </div>
      )
    }
  }

export default Secondprofile;
